import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="Title">Color Detector</div>
      <div class="Text"><ul>
        <li>Color Detector is an app made with React Native/Flask/Python, hosted on AWS</li>
        <li>Enter a word and an image will be generated, along with it 5 of the most prominent colors.</li>
        <li>App uses web scraping as well as machine color detection. Inspired by Angela He.</li>
        </ul></div>
        <div class="Input-Container">
          <form>
          <input type="text" id="search" name="search"></input>
          <input type="button" value="button" name="search"></input>
          </form>
        </div>
    </div>
  );
}

export default App;
